import React, { Component } from "react";
import "./actions.css";

class Actions extends Component {
  state = {};
  render() {
    return (
      <div className="fl w-100">
        <div className="fl w-100 tc">
          <h1 className="f2 lh-copy">Actions</h1>
        </div>
        <div className="fl w-100 tc">
          <div className="fl w-40">
            <p className="f3 lh-copy">Sélectionner un créancier</p>
          </div>
          <div className="fl w-20 f1">
            <p className="lh-title">vs</p>
          </div>
          <div className="fl w-40 f4">
            <p className="f3 lh-copy">Sélectionner un débiteur</p>
          </div>
        </div>
        <div className="fl w-100 tc">
          <div className="fl w-60">Checkboxes</div>
          <div className="fl w-40">Chercher</div>
        </div>
      </div>
    );
  }
}

export default Actions;
